// src/components/Chart.js
import React, { useState, useEffect } from 'react';
import {
  PieChart, Pie, BarChart, Bar, CartesianGrid, XAxis, YAxis, Tooltip, Legend, ResponsiveContainer, LineChart, Line
} from 'recharts';

const Chart = () => {
  // Initial state for Pie chart, Bar chart, and Line chart
  const [pieData, setPieData] = useState([
    { name: 'Shipped', value: 400 },
    { name: 'Completed', value: 300 },
    { name: 'Pending', value: 300 },
    { name: 'Canceled', value: 200 },
  ]);

  const [barData, setBarData] = useState([
    { name: 'Shipped', value: 400 },
    { name: 'Completed', value: 300 },
    { name: 'Pending', value: 200 },
  ]);

  const [lineData, setLineData] = useState([
    { name: 'Jan', uv: 400, pv: 2400, amt: 2400 },
    { name: 'Feb', uv: 300, pv: 1398, amt: 2210 },
    { name: 'Mar', uv: 200, pv: 9800, amt: 2290 },
    { name: 'Apr', uv: 278, pv: 3908, amt: 2000 },
    { name: 'May', uv: 189, pv: 4800, amt: 2181 },
    { name: 'Jun', uv: 239, pv: 3800, amt: 2500 },
  ]);

  // Simulate fetching new data every 5 seconds (for polling)
  useEffect(() => {
    const interval = setInterval(() => {
      // Simulate live data change (This should be replaced with actual API calls)
      setPieData(prevData =>
        prevData.map(item => ({
          ...item,
          value: item.value + Math.floor(Math.random() * 10), // Random update for example
        }))
      );

      setBarData(prevData =>
        prevData.map(item => ({
          ...item,
          value: item.value + Math.floor(Math.random() * 10), // Random update for example
        }))
      );

      setLineData(prevData =>
        prevData.map(item => ({
          ...item,
          uv: item.uv + Math.floor(Math.random() * 10),
          pv: item.pv + Math.floor(Math.random() * 10),
        }))
      );
    }, 5000); // Fetch every 5 seconds

    return () => clearInterval(interval); // Cleanup on component unmount
  }, []);

  return (
    <div className="dashboard">
      {/* Pie Chart */}
      <div className="chart">
        <h3>Order Status Breakdown</h3>
        <ResponsiveContainer width="100%" height={300}>
          <PieChart>
            <Pie
              data={pieData}
              dataKey="value"
              nameKey="name"
              cx="50%"
              cy="50%"
              outerRadius={100}
              fill="#8884d8"
              label
            />
          </PieChart>
        </ResponsiveContainer>
      </div>

      {/* Bar Chart */}
      <div className="chart">
        <h3>Order Quantities</h3>
        <ResponsiveContainer width="100%" height={300}>
          <BarChart data={barData}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="name" />
            <YAxis />
            <Tooltip />
            <Legend />
            <Bar dataKey="value" fill="#8884d8" />
          </BarChart>
        </ResponsiveContainer>
      </div>

      {/* Line Chart */}
      <div className="chart">
        <h3>Order Trends (Monthly)</h3>
        <ResponsiveContainer width="100%" height={300}>
          <LineChart data={lineData}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="name" />
            <YAxis />
            <Tooltip />
            <Legend />
            <Line type="monotone" dataKey="uv" stroke="#8884d8" />
            <Line type="monotone" dataKey="pv" stroke="#82ca9d" />
          </LineChart>
        </ResponsiveContainer>
      </div>
    </div>
  );
};

export default Chart;
